export default function GetGameData(data) {
    const instance = data;
    const GameData = {
        'date': instance.gdte,
        'time': instance.utctm,
        'city': instance.ac,
        'state': instance.as,
        'home': instance.hls.tn,
        'away': instance.vls.tn,
        'status': instance.st
    };

    return GameData;
}
